import {TableChild} from "../childcomponents/TableChild";
import {FormHeaderComponent} from "../childcomponents/FormHeaderComponent";
import {FormChild} from "../childcomponents/FormChild";

export const Settings = () => {
    const modifierDuree = () => {
        console.log("modifierDuree")
    }
    const parameters = {
        title: "Durée de l'enchère",
        subtitle: "Modifier la durée de l'enchère",
        button:{
            value:"Modifier"
        },
        event: modifierDuree,
    }
    const dureeEnchere=10;
    const inputs = [
        {
            label:"Durée",
            type:"number",
            placeholder:"Entrez la durée de l'enchère",
            name:"duree",
            className:"form-control myform",
            value: dureeEnchere
        }
    ]
    document.getElementById("page-description").innerHTML="Paramètres de l'application";
    document.getElementById("createBtn").style.display="none";
    return (
        <>
            <div className="container-fluid" style={{padding: '10px'}}>
                <div className="row">
                    <div className="col-md-12">
                        <div className="header mt-md-5">
                            <FormHeaderComponent title={"Paramètres"} description={"Page de modication des paramètres tel que la durée de l'enchère et la valeur de la comission à prélever après chaque transaction"}/>
                        </div>
                        <div className="card">
                            <div className="card-body">
                                <FormChild bottomLink={false} parameters={parameters} inputs={inputs}/>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}
